import React, { Component } from 'react';
import Navbar from './Navbar';
import Rooms from './Rooms';
import TextField from "@material-ui/core/TextField"
import { useEffect, useState } from "react"

export default function Home() {
    const [joinCode, setJoinCode] = useState("");
    const [createRoom, setCreateRoom] = useState("");
    const [message, setMessage] = useState("");
    useEffect(
        () => {
            const requestOption = {
                method: 'POST',
                headers: { 'Content-Type': 'application/json' },
                body: JSON.stringify({
                    email: window.email
                })
            }
            if (joinCode) {
                requestOption.code = joinCode;
                console.log(joinCode);
                fetch('http://localhost:8000/joinRoom/' + window.email, requestOption)
                    .then(res => res.json())
                    .then(data => setMessage(data.message))
            }
            if (createRoom) {
                requestOption.subject = createRoom;
                fetch('http://localhost:8000/addRoom/' + window.email, requestOption)
                    .then(res => res.json())
                    .then(data => setMessage(data.message))
            }
        }, [joinCode, createRoom]
    )

    return (

        <div style={{ backgroundColor: "#f5c27d", width: '100vw', height: '100vh' }}>
            <Navbar></Navbar>
            <h2>HOME</h2>
            <div className="row">
                <div className="col" style={{ maxWidth: '20%' }}>

                        <div className="input-group" style={{marginLeft:'auto'}}>
                            <h5> CreateRoom</h5>

                            <TextField name="message" label="Subject" />
                            <button className="btn btn-success">Create</button>

                        </div>

                </div>

                <div className="col" >
                    <Rooms
                    ></Rooms>
                </div>
            </div>

        </div>
    )

}
